INSERT INTO travel.room (id, capacity, description, image, name, price, room_type_id, stock, accommodation_id) VALUES (5714, 2, '옛날 안주인들이 기거하던 안방으로서, 창을 열면 ‘口’자로 지어진 양소당의 중정(中庭)을 볼 수 있고 넓은 대청마루가 있습니다. 에어컨이 비치되어 있어 여름에도 시원합니다. 맑은 밤이면 툇마루에 앉아 쏟아질 듯 무수한 별들을 감상할 수 있습니다.', 'http://tong.visitkorea.or.kr/cms/resource/33/2803233_image2_1.jpg', '안채안방, 대청마루', -1357188432, 55646, -1086459985, 1877312);
INSERT INTO travel.room (id, capacity, description, image, name, price, room_type_id, stock, accommodation_id) VALUES (5715, 3, '창을 열면 드넓은 동쪽 마당이 펼쳐지고 고요한 풍산 들녘을 바라볼 수 있습니다, 특히 동쪽으로 창이 나 있어, 날씨가 좋은 날에는 일출도 감상할 수 있는 인기 객실입니다. 안채안방과 건너방 사이에는 큰 마루와 테이블이 있고, 맑은 밤이면 창밖의 툇마루에 앉아 쏟아질 듯 무수한 별들을 구경하는 날도 많습니다. 객실 내에 에어컨이 비치되어 여름에도 시원합니다.', 'http://tong.visitkorea.or.kr/cms/resource/30/2803230_image2_1.jpg', '안채건너방, 대청마루, 툇마루', -1357188432, 55647, -1086459985, 1877312);
INSERT INTO travel.room (id, capacity, description, image, name, price, room_type_id, stock, accommodation_id) VALUES (5716, 4, '양소당의 큰사랑채로서 방이 2칸, 그리고 사랑마루가 부속되어 있는 큰 방입니다. 객실이 2칸이라 보다 여유로운 공간 사용이 가능하며, 둘러앉아 간단한 식사나 차를 마사고 좌담을 나눌 수 있는 별도의 마루를 가진 인기 객실입니다. 사랑마루에는 동쪽, 남쪽, 북쪽으로 열려있는 창을 통해서 풍산들녘의 수려한 경치를 볼 수 있습니다. 실내에 에어컨이 비치되어 있어 여름에도 시원합니다.', 'http://tong.visitkorea.or.kr/cms/resource/47/2803247_image2_1.jpg', '큰사랑채 (방 2칸, 거실)', -1357188432, 55648, -1086459985, 1877312);
INSERT INTO travel.room (id, capacity, description, image, name, price, room_type_id, stock, accommodation_id) VALUES (5717, 2, '창을 열면 동쪽 마당과 풍산 들녘의 수려한 경치를 내려다볼 수 있습니다. 또한 창밖에 따로 툇마루가 있어 외부에 나와 경치를 구경할 수 있습니다. 실내에 에어컨이 비치되어 있어 여름에도 시원합니다.', 'http://tong.visitkorea.or.kr/cms/resource/42/2803242_image2_1.jpg', '작은사랑채, 툇마루', -1357188432, 55649, -1086459985, 1877312);
INSERT INTO travel.room (id, capacity, description, image, name, price, room_type_id, stock, accommodation_id) VALUES (5718, 2, '작은방은 2개의 창이 나 있으므로 시원하면서도 아늑하고 조용한 객실입니다. 초여름에도 선풍기가 필요 없을 정도이며, 1인 여행으로 오신 분께 추천합니다.', 'http://tong.visitkorea.or.kr/cms/resource/35/2803235_image2_1.jpg', '작은방', -1357188432, 55650, -1086459985, 1877312);
